import React from "react";
import { FaSearch } from "react-icons/fa";
import { Card, CardContent } from "./components/ui/card";
import { Button } from "./components/ui/button";
import "./App.css";
import { useState } from 'react';
import Navigation from "./components/ui/Navigation";
import "./components/ui/Navigation.css"; 
import "./components/ui/Carousel.css"; 
import Carousel from "./components/ui/Carousel";
import Genre from "./components/ui/GenreSection";
import "./components/ui/GenreSection.css"; 

const Header = () => {
  const [sidebarOpen, setSidebarOpen] = useState(false);

  const toggleSidebar = () => {
    setSidebarOpen(!sidebarOpen);
  };

  return (
    <header className="header">
      <div className="hamburger-menu">
          <img src="images/menuIcon.png" alt="Menu" width="25" height="25" />
      <h1>AdSpecta</h1>
      </div>
      <div className="search">
        <input
          type="text"
          placeholder="Search Channel, Media"
        />
        <img src="images/search.png" alt="Search Icon" />
      </div>
      <div className="leftcorner">
        <a href="#">Contact Us</a>
        <div className="leftcorner">
          <img src="images/login.png" alt="Login" className="icon" />
          <a href="#">Login</a>
        </div>
        <div className="leftcorner">
          <img src="images/cart.png" alt="Cart" className="icon" />
          <a href="#" >Your Bag</a>
        </div>
      </div>
    </header>
  );
};


const App = () => {
  return (
    <div>
      <Header />
      <Navigation/>
      <Carousel />
      <Genre/>
    </div>
  );
};

export default App;
